function createCookie(name, value, days) {
    var expires;

    if (days) {
        var date = new Date();
        date.setTime(date.getTime() + (days * 24 * 60 * 60 * 1000));
        expires = "; expires=" + date.toGMTString();
    } else {
        expires = "";
    }
    document.cookie = encodeURIComponent(name) + "=" + encodeURIComponent(value) + expires + "; path=/";
}

function readCookie(name) {
    var nameEQ = encodeURIComponent(name) + "=";
    var ca = document.cookie.split(';');
    for (var i = 0; i < ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) === ' ')
            c = c.substring(1, c.length);
        if (c.indexOf(nameEQ) === 0)
            return decodeURIComponent(c.substring(nameEQ.length, c.length));
    }
    return null;
}
;
function initGDPRPanel() {
    if (readCookie("gdpr_panel_state") != "hidden") {
        $('.gdpr-cookies').removeClass('hidden');
    }

    $('.gdpr-cookies .close').on('click', function() {
        createCookie("gdpr_panel_state", "hidden");
        $('.gdpr-cookies').addClass('hidden');
    });
}
;
function animateFigures(callback) {
  var $withFallbacks = $('.gif[data-fallback]');
  if (glEnabled()) {
    var glAsset = $('[data-gl-assets]').data('glAssets');
    if (glAsset) {
      $.getScript(glAsset, function () {
        if (callback) {
          setTimeout(callback, 100);
        }
      });
    }
  } else {
    $withFallbacks.each(function () {
      var $gif = $(this);
      $gif.css({
        backgroundImage: 'url("' + $gif.data('fallback') + '")'
      });
    });
    if (callback) {
      setTimeout(callback, 100);
    }
  }
  $withFallbacks.removeAttr('data-fallback');
}

function glEnabled() {
  try {
    var canvas = document.createElement('canvas');
    return !!(window.WebGLRenderingContext && (canvas.getContext('webgl') || canvas.getContext('experimental-webgl')));
  } catch (e) {
    return false;
  }
}
;
function buttonsEffect() {

  $('.button.fx').append('<span class="ripple"></span>')
    .on('mouseenter mouseleave', function(e) {
      var parentOffset = $(this).offset();
      var relX = e.pageX - parentOffset.left;
      var relY = e.pageY - parentOffset.top;
      $(this).children('.ripple').css({
        top: relY,
        left: relX,
      });
    });
}
